package cn.edu.swpu.face_detection_register.service.impl;

import java.util.List;

import javax.annotation.Resource;

import cn.edu.swpu.face_detection_register.model.vo.*;
import org.springframework.http.HttpEntity;
import org.springframework.http.HttpHeaders;
import org.springframework.http.MediaType;
import org.springframework.stereotype.Component;
import org.springframework.stereotype.Service;
import org.springframework.web.client.RestTemplate;

import cn.edu.swpu.face_detection_register.cons.FaceDetectionRegisterConstrant;
import cn.edu.swpu.face_detection_register.model.dto.FaceRequestParam;
import cn.edu.swpu.face_detection_register.service.IFaceDetectionService;
import com.alibaba.fastjson.JSON;
import com.alibaba.fastjson.TypeReference;

/**
 * @Author: 季才
 * @Date: 2020/1/8
 * @Description:
 **/
@Service
public class FaceDetectionServiceImpl implements IFaceDetectionService {

    private RestTemplate restTemplate = new RestTemplate();

    @Override
    public AccessTokenVo getAccessToken() {
        //TODO 添加对缓存的支持
        return restTemplate.getForObject(FaceDetectionRegisterConstrant.BAIDU_GET_ACCESSTOKEN, AccessTokenVo.class,FaceDetectionRegisterConstrant.API_KEY,FaceDetectionRegisterConstrant.SECRET_KEY);
    }

    private ResponseVo<FaceRegisterVo> commonOperation(FaceRequestParam faceRequestParam,String url) {
        //获取access_token
        AccessTokenVo accessTokenVo = getAccessToken();
        HttpEntity<FaceRequestParam> request= getHttpEntity(faceRequestParam);
        String responseVo = restTemplate.postForObject(url,request,String.class,accessTokenVo.getAccessToken());
        return JSON.parseObject(responseVo, new TypeReference<ResponseVo<FaceRegisterVo>>(){});
    }

    @Override
    public ResponseVo<FaceRegisterVo> registerFace(FaceRequestParam faceRequestParam) {
        return commonOperation(faceRequestParam,FaceDetectionRegisterConstrant.BAIDU_ADD_FACE);
    }

    @Override
    public ResponseVo<FaceRegisterVo> updateFace(FaceRequestParam faceRequestParam) {
        return commonOperation(faceRequestParam,FaceDetectionRegisterConstrant.BAIDU_UPDATE_FACE);
    }

    @Override
    public ResponseVo deleteFace(FaceRequestParam faceRequestParam) {
        AccessTokenVo accessTokenVo = getAccessToken();
        HttpEntity<FaceRequestParam> param = getHttpEntity(faceRequestParam);
        String responseVo = restTemplate.postForObject(FaceDetectionRegisterConstrant.BAIDU_DELETE_FACE,param,String.class,accessTokenVo.getAccessToken());
        return JSON.parseObject(responseVo, new TypeReference<ResponseVo>(){});
    }

    private <T> HttpEntity<T> getHttpEntity(T data){
        HttpHeaders headers = new HttpHeaders();
        headers.setContentType(MediaType.APPLICATION_JSON);
        return new HttpEntity<>(data,headers);
    }

    @Override
    public ResponseVo<MatchFaceVo> matchFace(List<FaceRequestParam> faceRequestParam) {
        AccessTokenVo accessTokenVo = getAccessToken();
        HttpEntity<List<FaceRequestParam>> request= getHttpEntity(faceRequestParam);
        String responseVo = restTemplate.postForObject(FaceDetectionRegisterConstrant.BAIDU_MATCH_FACE,request,String.class,accessTokenVo.getAccessToken());
        return JSON.parseObject(responseVo, new TypeReference<ResponseVo<MatchFaceVo>>(){});
    }

    @Override
    public ResponseVo<DetectFaceVo> detectFace(FaceRequestParam faceRequestParam) {
        AccessTokenVo accessTokenVo = getAccessToken();
        HttpEntity<FaceRequestParam> request= getHttpEntity(faceRequestParam);
        String responseVo = restTemplate.postForObject(FaceDetectionRegisterConstrant.BAIDU_DETECT_FACE,request,String.class,accessTokenVo.getAccessToken());
        return JSON.parseObject(responseVo, new TypeReference<ResponseVo<DetectFaceVo>>(){});
    }

    @Override
    public ResponseVo<SearchFaceVo> searchFace(FaceRequestParam faceRequestParam) {
        AccessTokenVo accessTokenVo = getAccessToken();
        HttpEntity<FaceRequestParam> request= getHttpEntity(faceRequestParam);
        String responseVo = restTemplate.postForObject(FaceDetectionRegisterConstrant.BAIDU_SEARCH_FACE,request,String.class,accessTokenVo.getAccessToken());
        return JSON.parseObject(responseVo, new TypeReference<ResponseVo<SearchFaceVo>>(){});
    }

    public static void main(String[] args) {
        String param = "{\n" +
                "  \"image\": \"\",\n" +
                "  \"image_type\": \"BASE64\",\n" +
                "  \"face_field\": \"age,beauty,expression,face_shape,gender,glasses,landmark,landmark150,race,quality,eye_status,emotion,face_type,mask\"\n" +
                "}";
        IFaceDetectionService faceDetectionService = new FaceDetectionServiceImpl();
        ResponseVo<DetectFaceVo> detectFaceVoResponseVo = faceDetectionService.detectFace(JSON.parseObject(param, FaceRequestParam.class));
        System.out.println(JSON.toJSON(detectFaceVoResponseVo));
    }
}
